// Helper function to draw the image
void draw_cave(MatrixPanel_I2S_DMA* display, int offsetX, int offsetY) {
  for (int y = 0; y < cave_height; y++) {
    for (int x = 0; x < cave_width; x++) {
      uint8_t r = pgm_read_byte(&cave_red[y][x]);
      uint8_t g = pgm_read_byte(&cave_green[y][x]);
      uint8_t b = pgm_read_byte(&cave_blue[y][x]);
      display->drawPixelRGB888(x + offsetX, y + offsetY, r, g, b);
    }
  }
}

